import React from 'react';
import './App.css';
import Main from './Main';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class App extends React.Component {
  constructor() {
    super()
    this.state = {
      loading: true,
      questions: null
    }
  }
  async componentDidMount() {
    const url = "src/";
    //const url = "https://api.randomuser.me/";
    const response = await fetch("questions.json");
    const data = await response.json();    
    console.log(data);
    //this.setState({ questions: data.data[0], loading: false})
  }

  render() {
    return (
      <div id='main'>
        {this.state.loading || !this.state.person ? (
          <div>
            loading...
          </div>) :
          (<div>
            <Main
              question={this.state.questions.question1}
              type='checkbox'
            />
            <br></br>
            <Main
              question='Q2.This is the second question'
              type='TrueFalse'
            />
            </div>)
        }
      </div>
    );
  }
}
